('1205','7','9102','Grundstück Bittermann',Null,'Phantastische Meerblickgrundstück in der Nähe von Santa Maria','6729','Zwei sehr großzügige, benachbarte Gründstücke mit genehmigtem Villenprojekt in Portól.\r\nDie Plateaugrundstücke haben einen traumhaften Meerblick über die Bucht von Palma, und liegen in einer sehr ruhigen Lage, 4 km von Santa Maria entfernt. Das genehmigte Projekt von 2 Luxusvillen hat eine Konstruierte Fläche von ca. 500 m² Wohn-/ Nutzfläche, freie- und überdachte Terrassen sowie ein Schwimmbad. Das Grundstück hat eine Süd-West Orientierung.\r\n','6730','475000',Null,'2008-10-15 13:59:08','106','2008-11-10 15:44:24',Null,'266','110','156',1,'1','0',Null,Null,Null,'6731',Null,'0','0','0',Null,'2015-04-09 10:38:50',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'6732',Null,'6733',Null,'6734',Null,'6735',Null,'7950','0',0,'0');
